import React from 'react'

const HangmanWord = () =>{
    const word = "hang man"
    return(
        <div style={{textTransform:"uppercase", fontWeight:"bold", fontSize:"40px", display:"flex", flexDirection:"row"  }}>
            {word.split("").map((letter)=>{
             return  <div style={{borderBottom:"solid black 5px"}}>{letter}</div>
            })}
        </div>
    )
} 

export default HangmanWord;
